function Course(title, image) {
	this.title = title;
	this.image = image;
}

const games = [
	new Course(
		"Tamil",
		"https://img-a.udemycdn.com/course/750x422/1943066_7017_4.jpg"
	),

	new Course(
		"English",
		"data:image/jpeg;base64,"
	),
	new Course(
		"Mathematics",
		"https://m.jagranjosh.com/imported/images/E/Articles/CBSE-Class-12-Maths-Solved-Paper.jpg"
	),
	new Course(
		"Environmental Science",
		"data:image/jpeg;base64,"
	),
	new Course(
		"Social Studies",
		"https://image.shutterstock.com/image-vector/illustration-stickman-kids-looking-big-260nw-645606331.jpg"
	),
	new Course(
		"Hindi",
		"https://www.thestatesman.com/wp-content/uploads/2019/09/QT-O2-9.jpg"
	)

];

const place = document.querySelector(".courses");

games.forEach((game) => {
	const data = `
				<div class="card">
					<div class="content">
					<h2>${game.title}</h2>
					</div>
					<div class="image">
						<img
							src="${game.image}"
							alt="AC Origins"
						/>
					</div>
				</div>`;
	place.innerHTML += data;
});
